import React from 'react';
import ReactDOM from 'react-dom';
import {Header} from './header';
import {Main} from './main';
import {Footer} from './footer';
ReactDOM.render(
    <div>
    <Header/>
    <Main/>
    <Footer/>
    </div>,
    document.getElementById('root')
);
